function createpdf(name, surname, language, mark){
  var doc=new jsPDF('landscape', 'mm', 'a4');

  var imgData_1 = 'data:image/png;base64,';

  var imgData_2 = 'data:image/png;base64,';

  var imgData_3 = 'data:image/png;base64,';

  var imgData_4 = 'data:image/png;base64,';

  var imgData_5 = 'data:image/png;base64,';

  var fontSizes={
    HeadTitleFontSize:18,
    Head2TitleFontSize:16,
    TitleFontSize:14,
    SubTitleFontSize:12,
    BigFontSize: 18,
    NormalFontSize:10,
    SmallFontSize:8
  };

  var lineSpacing={
    NormalSpacing:12,
  };

  var rightStartCol1=10;
  var rightStartCol2=50;
  var rightcol1=rightStartCol1;
  var rightcol2=rightStartCol2;


  var InitialstartX=0;
  var startX=40;
  var InitialstartY=10;
  var startY=InitialstartY;

  var lineHeights=12;

  doc.setFontSize(40)
  console.debug(mark)
  //doc.text(120,20, 'Glifico certificate')
  if(mark=='1') doc.addImage(imgData_1, 'PNG', 80, 40, 120, 120)
  if(mark=='2') doc.addImage(imgData_2, 'PNG', 80, 40, 125, 125)
  if(mark=='3') doc.addImage(imgData_3, 'PNG', 80, 40, 125, 125)
  if(mark=='4') doc.addImage(imgData_4, 'PNG', 80, 40, 125, 125)
  if(mark=='5') doc.addImage(imgData_5, 'PNG', 80, 40, 130, 130)

  doc.setFontSize(fontSizes.SubTitleFontSize);
  doc.setFont('times');
  doc.setFontType('bold');
  doc.setFontSize(fontSizes.BigFontSize);


  doc.setFontType('bold');
  doc.textAlign("Glifico certifies that ", {align: "left"}, rightcol1, startY+=lineSpacing.NormalSpacing);
  doc.textAlign(name, {align: "left"}, rightcol1+=80, startY);
  doc.textAlign(surname, {align: "left"}, rightcol1+=40, startY);

  rightcol1=rightStartCol1;
  doc.textAlign("Successfully passed skill test translating in: ", {align: "left"}, rightcol1, startY+=lineSpacing.NormalSpacing);
  doc.textAlign(language, {align: "left"}, rightcol1+=150, startY);


  doc.save("award.pdf");
}
